import React, {Component} from 'react';
import axios from 'axios';

export default class chatRooms extends Component {
  constructor(props) {
    super(props);

    this.state = {
      error: null,
      isLoaded: false,
      items: []
    }
  }

  componentDidMount() {
    axios.post('http://localhost:5000/chatRoom/createroom')
    .then((req, res) => {
      this.setState({
        isLoaded: true,
        items: req.data
      })
    })
    .catch(err => {
      console.log(err);
    })
  }

  render() {
    return(
      <div>
        {this.items}
      </div>
    )
  }
}
